<div class="entities" style="line-height: 2.5; direction: ltr">Efficacy and safety of repeated dosing of netupitant , a neurokinin - 1 receptor antagonist , in treating overactive bladder . AIM : NK - 1 receptors in sensory nerves , the spinal cord and bladder smooth muscle participate in complex sensory mechanisms that regulate bladder activity . This study was designed to assess the efficacy and safety of a new 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P25103
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 antagonist , netupitant , in patients with OAB . METHODS : This was a phase II , multicenter , double-blind study in which adults with OAB symptoms &gt; 6 months were randomized to receive 1 of 3 doses of netupitant ( 50 , 100 , 200 mg ) or placebo once daily for 8 weeks . The primary efficacy endpoint was percentage change from baseline in average number of daily micturitions at week 8 . Urinary incontinence , urge urinary incontinence ( UUI ) , and urgency episodes were also assessed . RESULTS : The primary efficacy endpoint was similar in the treatment groups ( -13.85 for placebo to -16.17 in the netupitant 200 mg group ) with no statistically significant differences between netupitant and placebo . The same was true for most secondary endpoints although a significant difference for improvement in UUI episodes and a trend for the greatest decrease in urgency episodes were seen in the netupitant 100 mg group . 
<mark class="entity" style="background: linear-gradient(90deg, #003300, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

</mark>
 was well tolerated with most treatment emergent adverse events ( AEs ) being mild . While the overall incidence of AEs increased with netupitant dose , there was no evidence for this dose dependency based on relationship to treatment , intensity , or time to onset . CONCLUSIONS : The study failed to demonstrate superiority of netupitant versus placebo in decreasing OAB symptoms , despite a trend favoring netupitant 100 mg . There were no safety concerns with daily administration of netupitant over 8 weeks .</div>

<div class="entities" style="line-height: 2.5; direction: ltr">Distribution of polyamines and their biosynthetic enzymes in intestinal adaptation .

 ) , was highest in the crypt cells in the basal state and increased throughout the entire villus-crypt axis during refeeding and lactation , preserving a villus-crypt gradient opposite to that of ODC . During hyperplasia , all three polyamines increased .

 was highest in the villus-tip cells , paralleling ODC activity , whereas spermidine and spermine were highest in the crypt cells and paralleled the distribution of

 activity . Thus

 activity and spermidine and spermine content may play a more important role than ODC and putrescine in regulation of intestinal mucosal proliferation . It is also possible that the threefold increases in the low levels of ODC in the crypt cells are adequate to trigger cell proliferation , whereas the higher ODC levels in villus cells may represent an association with the differentiation of the enterocytes .</div>

 protects against ethanol-induced gastric mucosal injury in rats : role of 5 - hydroxytryptamine , prostaglandins and sulfhydryl compounds . This study was designed to determine the gastroprotective properties of cinitapride ( CNT ) , a novel prokinetic benzamide derivative agonist of

 and 5 - HT1 receptors and 5 - HT2 antagonist , on mucosal injury produced by 50 % ( v / v ) ethanol . Results were compared with those for 5 - hydroxytryptamine ( 5 - HT : 10 mg kg - 1 ) . The possible involvements of gastric mucus secretion , endogenous prostaglandins ( PGs ) and sulfhydryl compounds ( SH ) in the protection mediated by CNT were also examined . Intraperitoneal administration of CNT ( 0.50 and 1 mg kg - 1 ) , 30 min before ethanol , significantly prevented gastric ulceration and increased the hexosamine content of gastric mucus . CNT ( 1 mg kg - 1 ) also produced a significant increase in gastric mucosal levels of DB00917 , but did not induce any significant changes in SH values . On the contrary , pretreatment with 5 - HT worsened ethanol-induced erosions , however , did not affect gastric mucus secretion , glycoprotein content or DB00917 levels , although the non-protein SH fraction was significantly decreased . The present results demonstrate that the gastroprotective effects of CNT could be partly explained by a complex PG dependent mechanism . We suggest that 5 - HT dependent mechanisms through 5 - HT2 receptor blockade and 5 - HT1 receptor activation could be also involved .</div>
